var title_f40_24_41344="Proximal tubule endosomes";
var content_f40_24_41344=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=NEPH%2F62203&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=NEPH%2F62203&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 571px\">",
"   <div class=\"ttl\">",
"    CI endosomes and proximal tubule cells",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 551px; height: 365px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    Endosomes formed from the apical surface of the proximal tubular cell bring in filtered proteins that are subsequently degraded. This process involves acidification of the endosomal lumen by the proton-ATPase. The chloride channel allows chloride to enter the vesicle to neutralize the charge generated by the proton pump, and this promotes maximal acidification.",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Reproduced with permission from: George AL. Proc Natl Acad Sci USA 1998; 95:7843. Copyright &copy; 1998. National Academy of Sciences, USA.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
