var title_f40_24_41345="Acetabular transverse and posterior wall fractures";
var content_f40_24_41345=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=EM%2F75638&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=2\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=EM%2F75638&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=2\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 470px\">",
"   <div class=\"ttl\">",
"    Acetabular transverse and posterior wall fractures",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 387px; height: 407px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    (A) The appearance on the anteroposterior&nbsp;view is similar to that of&nbsp;a pure transverse fracture with disruption of five of the six radiograph landmarks; only the radiographic U (which maintains its normal relationship to the ilioischial line) remains intact. The posterior wall fragment is seen as an oblique cortical line overlying the intact roof (arrowhead).",
"    <br>",
"     (B) The obturator oblique shows the transverse fracture, the subluxation of the femoral head with the ischiopubic fragment, as well as the posterior wall fragment. It is easy to see on this view how the femoral head may abrade against the fracture edge while the hip is subluxated.",
"     <br>",
"      (C) The iliac oblique view highlights the fracture line exiting the greater sciatic notch as well as the posterior wall fragment superimposed on the roof of the acetabulum (black arrow).",
"      <br>",
"       (D) This computed tomography section shows the posterior wall fracture (white arrow) with a column fracture line typical of a transverse fracture (black arrowheads).",
"       <div class=\"footnotes\">",
"       </div>",
"       <div class=\"reference\">",
"        Originally published in: Moed BR, Reilly MC. Lower extremity: Acetabulum fractures. In: Rockwood and Green's Fractures in Adults, 7th ed, Bucholz RW, Court-Brown CM, Heckman JD, Tornetta P (Eds), Lippincott Williams &amp; Wilkins, Philadelphia 2010. Reproduced with permission. Copyright &copy; Berton R. Moed, MD.",
"       </div>",
"      </br>",
"     </br>",
"    </br>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
