"    </p>",
"    <p style=\"text-indent:-2em;margin-left:2em;text-align:justify;\">",
"     <b>",
"      Liquid",
"     </b>",
"     (Tricode GF Oral)",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:4em;text-align:justify;\">",
"     30-8-200 mg/5 mL (473 mL): $94.40",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:2em;text-align:justify;\">",
"     <b>",
"      Suspension",
"     </b>",
"     (Zodryl DEC 25 Oral)",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:4em;text-align:justify;\">",
"     5-1-20 mg/mL (118 mL): $35.00",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:2em;text-align:justify;\">",
"     <b>",
"      Suspension",
"     </b>",
"     (Zodryl DEC 30 Oral)",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:4em;text-align:justify;\">",
"     4.286-1-20 mg/mL (118 mL): $35.00",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:2em;text-align:justify;\">",
"     <b>",
"      Suspension",
"     </b>",
"     (Zodryl DEC 35 Oral)",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:4em;text-align:justify;\">",
"     3.75-1-20 mg/mL (118 mL): $35.00",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:2em;text-align:justify;\">",
"     <b>",
"      Suspension",
"     </b>",
"     (Zodryl DEC 40 Oral)",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:4em;text-align:justify;\">",
"     3.333-1-20 mg/mL (118 mL): $35.00",
"    </p>",
"   </div>",
"   <div class=\"list fbnlist drugH1Div drugBrandNames\" id=\"F178007\" xmlns=\"file://www.w3.org/1999/xhtml\">",
"    <span class=\"drugH1\">",
"     International Brand Names",
"    </span>",
"    <ul>",
"     <li>",
"      Benylin 3.3 mg-D-E (CA);",
"     </li>",
"     <li>",
"      Calmylin with Codeine (CA)",
"     </li>",
"    </ul>",
"   </div>",
