" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 470px\">",
"   <div class=\"ttl\">",
"    Acute cellular hepatic allograft rejection",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 432px; height: 285px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    High power light micrograph of a liver biopsy from a patient with acute cellular hepatic allograft rejection shows an expanded portal triad containing mixed inflammatory cells. These is also evidence of ductulitis and endotheliitis.",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Courtesy of Donald Jensen, MD.",
"    </div>",
"   </div>",
"  </div>",
