"  <div class=\"figure\" style=\"width: 470px\">",
"   <div class=\"ttl\">",
"    Acute hepatic allograft rejection",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 448px; height: 288px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    Medium power view of a liver transplant biopsy shows dense lymphocytic infiltrate (cellular rejection) and endotheliitis.",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Courtesy of Robert Odze, MD.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 470px\">",
"   <div class=\"ttl\">",
"    Endotheliitis in acute hepatic allograft rejection",
"   </div>",
