"   </div>",
"   <div class=\"lgnd\">",
"    Light micrograph of a liver biopsy from a liver transplant shows endotheliitis involving a central hepatic vein.",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Courtesy of Donald Jensen, MD.",
"    </div>",
"   </div>",
