var title_f40_24_41356="Nonprogressive versus progressive precocious puberty";
var content_f40_24_41356=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=PEDS%2F72017&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=3\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=PEDS%2F72017&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=3\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    Clinical characteristics of nonprogressive versus progressive precocious puberty",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <tbody>",
"      <tr>",
"       <td class=\"subtitle1\">",
"        &nbsp;",
"       </td>",
"       <td class=\"subtitle1\">",
"        Nonprogressive precocious puberty",
"       </td>",
"       <td class=\"subtitle1\">",
"        Gonadotropin-dependent",
"        <br/>",
"        (central)",
"        <br/>",
"        precocious puberty",
"       </td>",
"       <td class=\"subtitle1\">",
"        Gonadotropin-independent",
"        <br/>",
"        (peripheral)",
"        <br/>",
"        precocious puberty",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Physical examination: Advancement through pubertal stages (Tanner stage)",
"       </td>",
"       <td>",
"        No progression in Tanner staging during 3 to 6 months of observation",
"       </td>",
"       <td>",
"        Progression to next pubertal stage in 3 to 6 months",
"       </td>",
"       <td>",
"        Progression",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Growth velocity",
"       </td>",
"       <td>",
"        Normal for bone age and relationship to peak height velocity",
"       </td>",
"       <td>",
"        Accelerated (&gt;6 cm per year)*",
"       </td>",
"       <td>",
"        Accelerated*",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Bone age",
"       </td>",
"       <td>",
"        Normal",
"       </td>",
"       <td>",
"        Advanced for height age",
"       </td>",
"       <td>",
"        Advanced for height age",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Serum estradiol concentration (girls)",
"        <sup>",
"         &bull;",
"        </sup>",
"       </td>",
"       <td>",
"        Undetectable",
"       </td>",
"       <td>",
"        Measurable, variable, and increasing",
"       </td>",
"       <td>",
"        Measureable, variable, and increasing",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Serum testosterone concentration (boys, or girls with virilization)",
"        <sup>",
"         &bull;",
"        </sup>",
"       </td>",
"       <td>",
"        Prepubertal",
"       </td>",
"       <td>",
"        Pubertal and increasing",
"       </td>",
"       <td>",
"        Pubertal and increasing",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Basal (unstimulated) serum LH concentration",
"        <sup>",
"         &bull;",
"        </sup>",
"       </td>",
"       <td>",
"        Normal (prepubertal)",
"        <sup>",
"         &Delta;",
"        </sup>",
"       </td>",
"       <td>",
"        Normal or elevated (as compared to prepubertal levels)",
"        <sup>",
"         &Delta;",
"        </sup>",
"       </td>",
"       <td>",
"        Suppressed or normal (prepubertal)",
"        <sup>",
"         &Delta;",
"        </sup>",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        GnRH (or GnRHa) stimulation test",
"        <sup>",
"         &bull;",
"        </sup>",
"       </td>",
"       <td>",
"        LH peak in the prepubertal range",
"        <sup>",
"         &loz;",
"        </sup>",
"       </td>",
"       <td>",
"        LH peak elevated (in the pubertal range)",
"        <sup>",
"         &loz;",
"        </sup>",
"       </td>",
"       <td>",
"        No change from baseline, or LH peak in the prepubertal range",
"       </td>",
"      </tr>",
"     </tbody>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    <div class=\"footnotes\">",
"     * UNLESS the patient has already passed his or her peak height velocity at the time of evaluation, in which case growth velocity may be normal or decreased for chronological age.",
"     <br>",
"      <span class=\"bullet\">",
"       &bull;",
"      </span>",
"      Serum concentrations of gonadal steroids and LH should be measured using ultrasensitive assays with detection limits adapted to the pediatric age group (ie, LH detection limits near 0.1 mIU/mL).",
"      <br>",
"       &Delta; In most laboratories, basal prepubertal concentrations of LH are below 0.1 mIU/mL.",
"       <br>",
"        <span class=\"lozenge\">",
"         &loz;",
"        </span>",
"        In most laboratories, the upper limit of normal for LH after GnRH stimulation is 3.3 to 5.0 mIU/mL.",
"       </br>",
"      </br>",
"     </br>",
"    </div>",
"    <div class=\"reference\">",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
